import React from 'react'
import { withStyles } from "@material-ui/styles";

const styles = {
root:{
  // width:"100%",
  // height:"500px",
  // background:"black"
},
overFlow:{
  width:"100%" ,
  height:"800px",
  border:" 1px solid #E6E9EC", 
  borderRadius: "8px"
}
};

function ExpandableImage(props) {
  const { classes } = props;
  return (
    <div className={classes.root}>
      <iframe 
      className={classes.overFlow}
      src="https://overflow.io/embed/RBXSB7" 
      scrolling="no" 
      allowfullscreen
      styles={{border:" 1px solid #E6E9EC", borderRadius: "4px"}} />
    </div>
  )
}

export default withStyles(styles)(ExpandableImage);
